import React from 'react';
import "./Home.css";

function Home() {
  return (
    <div className="homepage">
    <div className="navbar">
        <img className='image1' src="../Utils/Images/bsphcllogo.jpg" alt="bsphcl"></img>
        <div>
        <h1 className="">Bihar State Power (Holding) Company Limited</h1>
        <p className="moto">Hamara Aadhaar... Urjasvit Bihar</p>
        </div>
        <img className="image2" src="../Utils/Images/bihar-govt222333444.jpg" alt="bihar_govt"></img>
    </div>
    </div>
  )
}

export default Home;
